public class InnerBudgetsActionDefinitionFactory(Action<Humidifier.Budgets.BudgetsActionTypes.Definition> factoryAction = null) : SubResourceFactory<Humidifier.Budgets.BudgetsActionTypes.Definition>
{

    internal InnerBudgetsActionSsmActionDefinitionFactory SsmActionDefinitionFactory { get; set; }

    internal InnerBudgetsActionIamActionDefinitionFactory IamActionDefinitionFactory { get; set; }

    internal InnerBudgetsActionScpActionDefinitionFactory ScpActionDefinitionFactory { get; set; }

    protected override Humidifier.Budgets.BudgetsActionTypes.Definition Create()
    {
        var definitionResult = CreateDefinition();
        factoryAction?.Invoke(definitionResult);

        return definitionResult;
    }

    private Humidifier.Budgets.BudgetsActionTypes.Definition CreateDefinition()
    {
        var definitionResult = new Humidifier.Budgets.BudgetsActionTypes.Definition();

        return definitionResult;
    }
    public override void CreateChildren(Humidifier.Budgets.BudgetsActionTypes.Definition result)
    {
        base.CreateChildren(result);

        result.SsmActionDefinition ??= SsmActionDefinitionFactory?.Build();
        result.IamActionDefinition ??= IamActionDefinitionFactory?.Build();
        result.ScpActionDefinition ??= ScpActionDefinitionFactory?.Build();
    }

} // End Of Class

